import type { jsPDF } from 'jspdf';

// Inter font (Latin + Latin Extended / Polish) - OFL License
// Subsetted from Google Fonts via @fontsource/inter
// Regular 400 + Bold 700, ~155KB each

const INTER_REGULAR_BASE64 = '';

const INTER_BOLD_BASE64 = '';

/**
 * Register Inter fonts (Regular + Bold) in a jsPDF document.
 * After calling this, use doc.setFont('Inter') for Polish-safe text.
 */
export function registerFonts(doc: jsPDF): void {
  doc.addFileToVFS('Inter-Regular.ttf', INTER_REGULAR_BASE64);
  doc.addFont('Inter-Regular.ttf', 'Inter', 'normal');
  doc.addFileToVFS('Inter-Bold.ttf', INTER_BOLD_BASE64);
  doc.addFont('Inter-Bold.ttf', 'Inter', 'bold');
  doc.setFont('Inter');
}

